    job_apply_quality_score: 0.5406,
    job_description:
      "Job Title: Computational Chemistry/Toxicology Scientist\n\nJob Location: Zionsville, IN 46077\n\nJob Duration: 12 Months\n\nThe client has an exciting and challenging opportunity in the Predictive Safety Center (PSC) within Regulatory Science for a Computational Chemistry/Toxicology Scientist. The individual will partner with a multidisciplinary team to design, develop, and implement machine learning models to predict safety profiles of chemicals to support the discovery, development and registration of novel crop protection products.\n\nResponsibilities:\n\n• Develop and apply chemistry structure-based predictive models for assessing safety profiles of early stage discovery molecules\n\n• Work collaboratively with internal and external cross-functional multidisciplinary teams, collaborators, and consultants to implement in silico models to meet business needs\n\n• Serve as a subject matter expert on in silico modelling for the team and other partners in R&D sub-functions\n\n• Present the development and application of cheminformatics approaches and novel ML/DL models internally and externally including scientific conferences\n\n• Keep abreast of the latest scientific development in the areas of machine learning, cheminformatics, and related fields and identify technologies to be applied internally\n\n• Provide mentorship and coaching to team members on in silico modelling and applications. Promote sharing of information and a team-oriented spirit of collaboration.\n\n• Analyze complex datasets using machine learning approaches and interpret results to improve data-driven decision-making processes.\n\nQualifications:\n\n• Ph.D. degree in Cheminformatics, Computational Chemistry, Computer Science, Statistics, Bioinformatics, Toxicology, or a related field\n\n• 3+ years of experience in developing machine learning models and applying cheminformatics and AI for structure-based drug design, toxicology assessment, and metabolism prediction\n\n• Strong technical background in machine learning, deep learning, and statistical modeling with prior experience in applying these techniques to process, analyze and draw insights from complex datasets involving chemical\n\ncompound structures and toxicity endpoints\n\n• Demonstrated programming proficiency in Python (and/or R) and experience in utilizing machine learning libraries\n\n• Demonstrated in-depth knowledge in toxicology, chemistry, chemical structure, QSAR, drug design, metabolism and ADMET\n\n• Experience in using ADMET modelling platform such as ADMET Predictor is preferred\n\n• Demonstrated teamwork and project leadership skills to manage multiple projects on different timelines for stakeholders across the business\n\n• Excellent communication and presentation skills to different stakeholder audiences\n\nBelow is the brief introduction of SPECTRAFORCE, the benefits we offer and the disclaimers:\n\nEstablished in 2004, SPECTRAFORCE is one of the largest and fastest-growing diversity-owned staffing firms in the US. The growth of our company is a direct result of our global client service delivery model that is powered by our state-of-the-art A.I. proprietary talent acquisition platform, robust ISO 9001:2015/ISO 27001 certified processes, and strong and passionate client engaged teams.\n\nWe have built our business by providing talent and project-based solutions, including Contingent, Permanent, and Statement of Work (SOW) services to over 130 clients in the US, Canada, Puerto Rico, Costa Rica, and India. Key industries that we service include Technology, Financial Services, Life Sciences, Healthcare, Telecom, Retail, Utilities and Transportation.\n\nSPECTRAFORCE is built on a concept of “human connection,” defined by our branding attitude of NEWJOBPHORIA®, which is the excitement of bringing joy and freedom to the work lifestyle so our people (and clients) can reach their highest potential. Our entire workflow and teams are trained to cultivate the joy of NEWJOBPHORIA® with candidates and employees throughout their engagement with SPECTRAFORCE. http://www.spectraforce.com\n\nBenefits: SPECTRAFORCE offers ACA compliant health benefits as well as dental, vision, accident, and hospital indemnity insurances. Additional benefits SPECTRAFORCE offers to the eligible employees include commuter benefits, 401K plan with matching and a referral bonus program. SPECTRAFORCE offers unpaid leave as well as paid sick leave when required by law.\n\nEqual Opportunity Employer: SPECTRAFORCE is an equal opportunity employer and does not discriminate against any employee or applicant for employment because of race, religion, color, sex, national origin, age, sexual orientation, gender identity, genetic information, disability or veteran status, or any other category protected by applicable federal, state, or local laws. Please contact Human Resources at nahr@spectraforce.com if you require reasonable accommodation",
