    job_apply_is_direct: false,
    job_apply_quality_score: 0.499,
    job_description:
      "At Apartment List, we’re on a mission to find every renter a home they love at the value they deserve. Finding the right place to live is one of the most important, time-consuming and expensive decisions that all of us make. Getting it right matters. We’ve helped nearly 1 million families find a home they love, and we’re just getting started.\n\nWe’re passionate about building a world-class sales team, as we believe that exceptionally talented people are the key to delivering a great customer experience at every turn. We provide a unique opportunity to grow by being surrounded by a team of brilliant and experienced individuals and leaders.\n\nOur team is dedicated to cultivating personal and professional development by creating a culture of feedback, transparency, innovation, passion, learning, and winning. Our business is dependent on happy clients who understand and participate in the Apartment List vision. We are seeking a tenacious team member to join the sales team who loves evangelizing a disruptive, new real estate marketplace advertising opportunity and wants to be part of a growing, evolving team.\n\nAt Apartment List, we’re on a mission to find every renter a home they love at the value they deserve. Finding the right place to live is one of the most important, time-consuming and expensive decisions that all of us make. Getting it right matters. We’ve helped nearly 1 million families find a home they love, and we’re just getting started.\n\nAs a Sr. Product Analyst, you will partner with cross functional teams (engineering, PM, and design) to deliver insights and features that support the renter journey throughout our platform and to develop best-in-class measurement of the business impact of features.\n\nHere’s what you’ll do as part of the team:\n• Join renter experience team and analyze user behavior, developing strategic insights informing experiment design and defining KPIs for features designed to help renters find properties they love.\n• Pull, clean, analyze, and transform data to understand business performance and communicate findings to stakeholders.\n• Design experiments, analyze user behavior to drive thoughtful and strategic decision making on our product team.\n\nHere are the skills and experience you’ll need to be successful:\n• Bachelor’s degree in CS, Math, Statistics, Innovation or similar discipline\n• Min. 3+ years in job offered or in a similar data analytics/scientist role\n• Successful technical screening.\n• This role requires one with strong data narrative communication skills, A/B testing background and expertise in SQL and data wrangling.\n\nHere's the Pay Range:\n\nAt Apartment List, we carefully consider a variety of factors to determine compensation for each position, including the role, level, and work. The US base salary range for this position is $126,277 - $150,000. Please note, the compensation details reflect base salary only and do not include bonus, benefits, and perks that we offer.\n\nWe also rely on market indicators along with considering your work location, job related skills, experience and relevant education and training, to determine compensation that is fair and competitive for you. Apartment List will consider paying compensation near the higher of the range in exceptional circumstances, where candidates have the experience, credentials or expertise that would warrant such consideration. It is always our goal to hire exceptional talent and we would be happy to share more about compensation during the hiring process.\n\nHere's what's in it for you (full-time employees only):\n• Competitive Compensation: Including annual salary, pre-IPO stock options, and other financial compensation (if applicable)\n• Medical, Dental, and Vision Coverage: 100% of premiums covered for you AND all of your dependents\n• Unlimited Flexible Time Off: Unlimited FTO in addition to 11 company holidays per year, quarterly “recharge” days, and a week-long holiday break\n• Home Office Reimbursement: To cover home office furniture and supplies, monthly home internet, and monthly cell phone (if applicable)\n• Health & Wellness Reimbursement: To cover monthly gym membership or other qualifying expenses\n• Parental Support: Generous parental and family leave, fertility benefits, and employer-sponsored stipends towards family forming services\n• 401k Plan: To support you in your individual retirement goals\n• Team Events: Frequent team-building events, fun team off-sites, and bi-annual company meetups (ski trip, etc.)\n• Commitment to DEI: To prioritize Diversity, Equity, and Inclusion within our workplace and to stay true to our values and mission\n• Mentorship and Training: To get you onboard quickly, learn new professional skills, and invest in your career development\n• Impact and Visibility: To expose you to and provide the opportunity to work on highly strategic initiatives that will transform the business\n• Encouragement and Empowerment: To explore and adopt new technologies and drive meaningful decisions and outcomes\n\nAt Apartment List we believe that everyone deserves a home they love AND a career they love. We strive to build a diverse team that is a reflection of the people we serve; this is made possible through our commitment to fostering a culture of diversity, inclusion, equity, and connectedness.\n\nAs a proud equal opportunity employer, we celebrate the collection of individual differences, life experiences, ideas, perspectives, knowledge, and talent. We hire candidates of any race, color, ancestry, religion, sex, national origin, sexual orientation, gender identity, age, marital or family status, disability, Veteran status, and any other status.",
