    job_apply_is_direct: false,
    job_apply_quality_score: 0.5487,
    job_description:
      "Join an elite group of sellers bringing customized, white glove experiences directly to the customer's door. Field Sales Representatives at AT&T are driven to connect -every interaction is an opportunity to introduce the latest technology and services, thriving on the challenge to make your sales goals happen. With uncapped commission potential, your career and the rewards that come with it are within reach.\n\nYou'll be the face and voice of AT&T to your customers -and with that comes the autonomy to organize your day to meet customers at the time and place that enhances the personalized sales interactions you create. You'll close the deal by offering hands-on demos, WiFi assessments, tech delivery and issue resolutions -keeping customers connected to what matters most to them. How you get the job done\n• We'll kick things off with paid training -setting you up for success to work independently in the field. Coaching, mentoring and ongoing learning opportunities will keep you on track and tech-savvy.\n• Generate leads -you are ready to take a cold call all the way to the sale while managing and achieving sales targets.\n• You'll use strong negotiation and communications skills -you know how to make a smooth pivot, and are highly motivated to get it right and make the sale Key expectations to succeed\n• Some prior sales experience - preferably in an environment with set targets\n• Maintain a valid driver's license - a big perk of this job is the company car we provide, make sure you're ready to drive.\n• Work a varied schedule designed to meet customers on their timeline -this may include evenings, weekends and holidays.\n• Utilize required PPE and adhere to all safety measures, including basic sanitizing procedures.\n\nOur Field Sales Representatives earn between $41,000 - $61,100 + up to $20,000 in commissions yearly if all sales goals are met. Not to mention all the other amazing rewards that working at AT&T offers. Individual starting salary within this range may depend on geography, experience, expertise, and education/training.\n\nJoining our team comes with amazing perks and benefits:\n• Medical/Dental/Vision coverage\n• 401(k) plan\n• Tuition reimbursement program\n• Paid Time Off and Holidays (based on date of hire, at least 23 days of vacation each year and 9 company-designated holidays)\n• Paid Parental Leave\n• Paid Caregiver Leave\n• Additional sick leave beyond what state and local law require may be available but is unprotected\n• Adoption Reimbursement\n• Disability Benefits (short term and long term)\n• Life and Accidental Death Insurance\n• Supplemental benefit programs: critical illness/accident hospital indemnity/group legal\n• Employee Assistance Programs (EAP)\n• Extensive employee wellness programs\n• Employee discounts up to 50% off on eligible AT&T mobility plans and accessories, AT&T Internet (and fiber where available) and AT&T phone\n\nIf you are considering jobs like Direct Sales Representative, Inside/Outside Sales Representative, Residential Sales Representative, Territory Sales Representative or Field Sales Executive - Home Solutions, this career move would be a great fit!\n\nReady to take your career on a new route? Apply today.\n\nAT&T will consider for employment qualified applicants in a manner consistent with the requirements of federal, state and local laws\n\nWe expect employees to be honest, trustworthy, and operate with integrity. Discrimination and all unlawful harassment (including sexual harassment) in employment is not tolerated. We encourage success based on our individual merits and abilities without regard to race, color, religion, national origin, gender, sexual orientation, gender identity, age, disability, marital status, citizenship status, military status, protected veteran status or employment status",
