      'Project Manager\n\nPurpose of the Position : The Project Manager will be working with the project delivery team members to help large and complex enterprise organizations transform their business while implementing Beeline solutions. Successful candidates must be able to manage a highly complex project within the specified timeline and budget to meet the requirements of the client successfully. It is also critical that this individual be skilled at managing issues and mitigating risks as it relates to the delivery of the implementation. Successful candidates will be able to demonstrate an understanding that both external and internal project teams are their customer.\n\nLocation: This is a UK based fully remote based opportunity (some travel to client sites in UK and Europe may be required on an ad-hoc basis)\n\nResponsibilities :\n\n· Deliver high level presentations to audiences ranging from executives to system end users.\n\n· Drive end to end projects in collaboration with client project manager to a successful deployment of the Beeline solutions.\n\n· Act as the key liaison and business partner to the client at both the project management and executive level as needed.\n\n· Identify resource needs, manage resource time allocation, and hold team accountable to deadlines.\n\n· Create and manage the project plan, focusing on maintaining project timelines and ensuring milestones are met.\n\n· Manage issues and risk by clearly communicating both internally and externally, escalating as needed and deploying risk mitigation strategies as appropriate.\n\n· Reporting on available resources, budget, and project status to project sponsors and stakeholders\n\n· Ability to work on multiple, concurrent tasks and adapt to shifting priorities, demands and timelines.\n\n· Effective communication and teamwork with project teams and collaboration with other departments\n\n· Understand priorities, scope, timeline, goals, and key milestones.\n\n· Maintain customer focus and demonstrate leadership to drive consensus and project related decisions.\n\n· Manage client expectations appropriately with the ability to manage through challenging situations with positive outcomes.\n\nRequirements :\n\n· Bachelor’s degree or equivalent work experience\n\n· 5 years’ experience working in a professional service setting implementing software projects for external clients.\n\nDesired Competencies :\n\n· Proficient at developing and managing project schedules\n\n· Experience managing a project team that includes business and technical consultants.\n\n· Excellent written and verbal communication skills.\n\n· Ability to multitask on concurrent projects and deliver work on time and under budget.\n\n· Engaged and confident presence with client- one who can establish and sustain credibility and trust.\n\n· Ability and desire to drive change through high-energy, can-do attitude, comfortable working in a high-performance, entrepreneurial, open-door environment.\n\n· Must be an outstanding communicator and team player who demonstrates attention to detail\n\n· Strong analytical and problem-solving skills\n\n· Ability to work autonomously.\n\nOur Company: At Beeline, we cultivate a positive work environment and are passionate about who we are and what we do. We are a 20-year industry leader disrupting the world of external workforce technology. Businesses across all industries use our technology to manage more than 30 million workers and over $700 billion in talent spend across 120 countries. Ideal candidates are intensely curious about technology, thrive in a less-than-formal work environment, and excel in a fast-paced, rapidly changing environment. We are looking for talented, driven, and adaptable people who will contribute to our vision, mission, and our future!\n\nOur Vision : Every person, given the right opportunity, is capable of greatness. Every business, given the right talent, is capable of superior outcomes.\n\nOur Mission : Our trusted platform connects businesses to the remarkable talent within the global extended workforce.\n\nTo learn more about Beeline, our solutions, our culture, and available positions visit https://www.beeline.com/.\n\nThis list of "Requirements and Responsibilities" is not intended to be limiting. The Company reserves the right to revise this job description based on the actual job requirements as varied from time to time.\n\nEqual Opportunity Employer Minorities/Women/Veterans/Disabled',
